                              The Ancient Celts - 2010kaiser
                              ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


Product Description: The archetypal 'barbarians from the north', the Celts were feared for their ferocity in battle and admired as skilled craftsmen. For two and half thousand years the Celts have continued to fascinate all who have come into contact with them. &quot;The Ancient Celts&quot; presents an absorbing account of the tribes whose origins and identity still provoke heated debate. Exploring the archaeological reality of the Iron Age inhabitants of barbarian Europe, Professor Cunliffe traces the emergence of chiefdoms, patterns of expansion and migration, and the development of Celtic ethnicity and identity.

Title: The Ancient Celts
Author: Barry Cunliffe
Publisher: Penguin
Year: 2000
ISBN: 0140254226
Format: PDF (Scanned)


